import React, { useState } from 'react';
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';

// Icons made by <a href="https://www.flaticon.com/authors/vectors-market" title="Vectors Market">Vectors Market</a> from <a href="https://www.flaticon.com/" title="Flaticon"> www.flaticon.com</a>

const EndSessionModal = ({ handleClose, show }) => {
  const [rating, setRating] = useState('');

  return (
    <Modal show={show} onHide={handleClose}>
      <Modal.Header closeButton>
        <Modal.Title>End Session</Modal.Title>
      </Modal.Header>
      <Modal.Body className="text-center">
        <h5 className="mt-4 mb-4">Rate your buddy!</h5>
        <img className="xs-icon" src="/one.png" alt="one" />
        <img className="xs-icon" src="/two.png" alt="two" />
        <img className="xs-icon" src="/three.png" alt="three" />
        <img className="xs-icon" src="/four.png" alt="four" />
        <img className="xs-icon" src="/five.png" alt="five" />
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={handleClose}>
          Cancel
        </Button>
      </Modal.Footer>
    </Modal>
  );
};

export default EndSessionModal;
